                    <h3>Due date: august 5</h3>
                    <h2>File:</h2>
                    <img src = 'https://img.icons8.com/fluent/48/000000/task.png'></img>
                    <label>Submit Answer:</label>
                    <input type = "file"></input>
                    <button>Submit</button>
                </div>
            </div>
        )
    }
}
